import React from 'react';
import Birth from '../Media/Birthday.svg';

export const Birthday = () => {
  return (
    <div className="birthday">
    <img className="birthday_image" src={Birthday} />
    <div className="birthday_cta">
      <h1 className="birthday_headline">Give Amazing Birthday Gifts From Our Top Picks!</h1>
      <p className="birthday_p">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Repellat harum animi temporibus iure adipisci deserunt, quae et itaque, quis totam alias. Itaque deleniti perspiciatis aliquam.
      </p>
      <div className="birthday_buttons">
        <button type="button" className="btn btn-primary btn-lg px-4 me-md-2">
          Check out birthday gifts
        </button>
      </div>
    </div>
  </div>
  )
}
